(()=>{window.Webflow||(window.Webflow=[]);window.Webflow.push(()=>{Array.from(document.querySelectorAll("[brs-multirefsort-element='list']")).forEach(r=>{if(!r)return;let t=Array.from(r.querySelectorAll(".w-dyn-item")),o=r.getAttribute("brs-multirefsort-order").toLowerCase()!=="desc";t.forEach(e=>e.parentElement.removeChild(e)),t.sort((e,l)=>{let s=e.querySelector("[brs-multirefsort-element='sortvalue']").textContent,n=l.querySelector("[brs-multirefsort-element='sortvalue']").textContent;return s>n?o?1:-1:s<n?o?-1:1:0}),t.forEach(e=>r.append(e))})});})();
